import React from 'react';
import './App.css';
import NavigationBar from './component/NavigationBar.js';
import Welcome from './component/Welcome.js';
import Foot from './component/Foot.js';
import VerticalSidebar from './component/SideBar.js';
import sideItems from './component/_nav.js';
//import BookList from './component/BookList.js';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import { Header, Icon, Image, Menu, Segment, Sidebar } from 'semantic-ui-react'

function App() {
  const marginTop = {
		  marginTop:"20px"
  };
  const items=[
	{
	  label: 'Dashboard',
	  linkto: '/dashboard',
	},
	{
	  label: 'Order Product',
	  linkto: '#',
	},
	{
	  label: 'View Product',
	  linkto: '#',
	},

	{
	  label: 'View Employee',
	  linkto: '#',
	},
	{
	  label: 'Import Sales Record',
	  linkto: '#',
	},

  ];

  return (
	<div className="app">
		<Router>
		<NavigationBar/>
		<Sidebar.Pushable as={Segment}>
		<VerticalSidebar items={sideItems.items}/>
		<Sidebar.Pusher>
      <Segment basic>
        <Header as='h3'>Application Content</Header>
		<Welcome/>
      </Segment>
    </Sidebar.Pusher>
		</Sidebar.Pushable>
  </Router>
  <Foot/>
  </div>
  );
}

export default App;
